import numpy as np
import subprocess

def yuv420_array_to_jpg_ffmpeg(yuv_array, width, height, output_filename):
    temp_yuv_file = "temp.yuv"

    # Save raw YUV data to a temporary file
    with open(temp_yuv_file, "wb") as f:
        f.write(yuv_array.tobytes())

    # Use FFmpeg to convert YUV to JPG
    ffmpeg_command = [
        "ffmpeg",
        "-s", f"{width}x{height}",  # Set resolution
        "-pix_fmt", "yuyv422",  # Set pixel format
        "-i", temp_yuv_file,  # Input file
        "-frames:v", "1",  # Extract 1 frame
        output_filename  # Output file
    ]

    subprocess.run(ffmpeg_command, check=True)
    print(f"Saved {output_filename}")

